import '../css/Cake.css'

const Cake = () => {
  return (
    <div>
      <div class="box-canvas">
        {/* <div class="plate"></div> */}
        <div class="cake-side"></div>
        <div class="drips">
          <div class="drip"></div>
          <div class="drip"></div>
          <div class="drip"></div>
          <div class="drip"></div>
          <div class="drip"></div>
          <div class="drip"></div>
          <div class="drip"></div>
          <div class="drip"></div>
        </div>
        <div class="cake-top"></div>
      </div>
    </div>
  );
}

export default Cake;
